def shortestPalindrome(s):
    for i in reversed(range(len(s) + 1)):
        t = s[:i]
        if t == t[::-1]:
            prefix = s[i:]
            return prefix[::-1] + s
    return ""

def test():
    shortestPalindrome("aacecaaa")
    shortestPalindrome("abcd")
    shortestPalindrome("aaacbaaa")
    shortestPalindrome("")

test()
